import React from "react";
import RingLoader from "react-spinners/RingLoader";

export default function LoadingSpinner(props) {
  return (
    <RingLoader
      color="#fb4226"
      size={60}
      style={{
        position: "relative",
        top: "50%",
        left: "50%",
        transform: "translate(-50%,-50%)",
      }}
    />
  );
}
